    "2016-07-27T22:57:54.176403",nt"name": "mcnary-rough-fish-control",nt"isopen":
    false,nt"url": null,nt"notes": "The purpose of the action is to enhance
    environmental conditions in the McNary Slough by reducing the population of rough
    fish, including common carp (Cyprinus carpio) and bullheads (Ameriurus spp.). Sampling
    conducted in 2012 found that three of the four pools of the McNary Sloughs are effectively
    denuded of any submerged aquatic vegetation and all four pools show high turbidity,
    a common symptom of carp infestation. Visual observations of all four pools show
    high levels of carp presence. The goal of the action is to reduce the current population
    of rough fish by a minimum of 99 percent and to maintain the population at or below
    this reduced level.",nt"license_title": "License Not Specified",nt"extras":
